import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='main'>
          <div className='main-nav'>
            <ul>
              <li>WELCOME</li>
              <li>CONTACT</li>
              <li>ABOUT</li>
            </ul>


          </div>

        </div>
      </header>
    </div>
  );
}

export default App;
